" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Evaluation for hypothyroidism in childhood cancer survivors",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_left\" rowspan=\"3\">",
"        History",
"       </td>",
"       <td>",
"        Cranial irradiation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Total body radiation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chemotherapy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_left\" rowspan=\"2\">",
"        Clinical evidence",
"       </td>",
"       <td>",
"        Slow growth rate",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Delayed puberty",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_left\" rowspan=\"6\">",
"        Review of systems*",
"       </td>",
"       <td>",
"        Fatigue",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Excessive sleeping",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Disinterest in physical activity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dry skin or eczema",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cold intolerance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Constipation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_left\" rowspan=\"3\">",
"        Screening and diagnostic tests",
"       </td>",
"       <td>",
"        Free T4",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <p>",
"         TSH (in some cases, a ratio of 8 AM to 4 PM TSH levels",
"        </p>",
"        <p>",
"         &nbsp;&nbsp;&nbsp;&nbsp;may&nbsp; confirm central or mixed hypothyroidism)",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Bone maturation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_left\" rowspan=\"4\">",
"        Associated endocrinopathies",
"       </td>",
"       <td>",
"        GH deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        ACTH deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Precocious puberty",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Gonadotropin deficiency",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     TSH: thyrotropin (thyroid stimulating hormone); TRH:&nbsp;thyrotropin releasing hormone; GH: growth hormone; ACTH: adrenocorticotropin.",
"     <br>",
"      * Patients have often accommodated to their symptoms and do not complain.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
