var content_f42_48_43788=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F51786&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F51786&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Clinical features of more common optic neuropathies*",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Optic neuritis",
"       </td>",
"       <td class=\"subtitle1\">",
"        Non-arteritic ischemic optic neuropathy",
"       </td>",
"       <td class=\"subtitle1\">",
"        Arteritic ischemic optic neuropathy",
"       </td>",
"       <td class=\"subtitle1\">",
"        Leber's hereditary optic neuropathy",
"       </td>",
"       <td class=\"subtitle1\">",
"        Neuroretinitis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Age",
"       </td>",
"       <td>",
"        20 to 50 years",
"       </td>",
"       <td>",
"        &gt;50 years",
"       </td>",
"       <td>",
"        &gt;70 years",
"       </td>",
"       <td>",
"        25 to 40 years",
"       </td>",
"       <td>",
"        Children",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Gender",
"       </td>",
"       <td>",
"        2:1 female",
"       </td>",
"       <td>",
"        Equal",
"       </td>",
"       <td>",
"        3.5:1 female",
"       </td>",
"       <td>",
"        80 to 90 percent male",
"       </td>",
"       <td>",
"        Equal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pain",
"       </td>",
"       <td>",
"        Present in &gt;90 percent",
"       </td>",
"       <td>",
"        Present in &lt;10 percent",
"       </td>",
"       <td>",
"        Headache, scalp tenderness, jaw claudication",
"       </td>",
"       <td>",
"        Not present",
"       </td>",
"       <td>",
"        Variable",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Onset",
"       </td>",
"       <td>",
"        Hours to days",
"       </td>",
"       <td>",
"        Sudden",
"       </td>",
"       <td>",
"        Sudden",
"       </td>",
"       <td>",
"        Weeks to months",
"       </td>",
"       <td>",
"        Hours to days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Unilateral or bilateral",
"       </td>",
"       <td>",
"        Usually unilateral",
"       </td>",
"       <td>",
"        Usually unilateral; low chance may recur in other eye years later",
"       </td>",
"       <td>",
"        May occur in both eyes in rapid sequence",
"       </td>",
"       <td>",
"        Bilateral - but presentation often unilateral",
"       </td>",
"       <td>",
"        Often bilateral",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Funduscopic examination",
"       </td>",
"       <td>",
"        Papillitis present in one-third",
"       </td>",
"       <td>",
"        Papillitis present in most",
"       </td>",
"       <td>",
"        Pale swelling of disc; fundus may also be normal (posterior ischemic optic neuropathy - indicates giant cell arteritis)",
"       </td>",
"       <td>",
"        Disc hyperemia but no swelling; peripapillary telangiectasia",
"       </td>",
"       <td>",
"        Papillitis, macular edema, exudates",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Visual field defect",
"       </td>",
"       <td>",
"        Central scotoma",
"       </td>",
"       <td>",
"        Altitudinal (usually inferior) defect",
"       </td>",
"       <td>",
"        Altitudinal or generalized constriction",
"       </td>",
"       <td>",
"        Central or cecocentral defect",
"       </td>",
"       <td>",
"        Variable",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Magnetic resonance imaging: optic nerve",
"       </td>",
"       <td>",
"        Inflammation of optic nerve in most (one-third to one-half will have other demyelinating lesions)",
"       </td>",
"       <td>",
"        Often normal",
"       </td>",
"       <td>",
"        May show enhancement",
"       </td>",
"       <td>",
"        Normal",
"       </td>",
"       <td>",
"        Variably abnormal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Prognosis",
"       </td>",
"       <td>",
"        Begins within two to four weeks, most achieve 20/40 or better",
"       </td>",
"       <td>",
"        Over several months, only 40 percent improve by three or more lines",
"       </td>",
"       <td>",
"        Poor once vision loss has occurred; may cause rapid blindness untreated",
"       </td>",
"       <td>",
"        One-third achieve some improvement",
"       </td>",
"       <td>",
"        Most recover fully",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Other diagnoses are described in the text \"Optic neuropathies.\"",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
